import React from 'react';
const About = () => {
    return(
        <>
        <div class="gif-bg">
	        <div class="container-fluid custom-jumbotron" id="home">
	            <div class="row">
	                <div class="col-lg-12">
	                    <HEADER>
	                    <h1 class="main-header animated bounceInLeft">Hello, I'm Dhruv</h1>
                        <p class="main-sub-header animated bounceInRight">I'm a <b> Second Year Undergraduate</b> student studying <b>Mechanical Engineering</b> at the <b>National Institute of Technology, Karnataka</b>.</p>
                   
	                    </HEADER>
	                </div>
	            </div>
	        </div>
		</div>
        </>
    )
}
export default About;
